// 최상단 My todo list , React 가 보이는 섹션

import React from 'react';
import './style.css';

function Header () {
    return (
        <div style={(style)}className="section1">
            <div>My Todo List</div>
            <div>React</div>
        </div>
        )
}

export default Header;
